import React from 'react';
import './index.css';
import logo from './images/romalogo.svg'

function Header(){

    return(
        <div className="header" >
            <button>Главная</button>
            <button>Блог</button>
            <img src={logo} alt="logo"/>
            <button>История успеха</button>
            <button>ВК</button>
        </div>
        );
}


export default Header;
